import React from "react";
import "./AboutSub4.css";

function AboutSub4() {
  return (
    <>
      <div className="vloggers">
        <p className="vloggersHeading">Our Hotel YouTube References</p>
        <div className="vloggersPhoto"></div>
      </div>
    </>
  );
}

export default AboutSub4;
